import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import axiosInstance from "../../baseurl";

function ViewTrainerPrograms() {
  const { id } = useParams;
  const [pgmreq, setpgmreq] = useState([]);
  const [approvedpg, setapprovedpgm] = useState([]);

  useEffect(() => {
    axiosInstance
      .post(`/viewPgmByTrainerId/${id}`)
      .then((res) => {
        console.log(res, "program requests");
      })
      .catch((err) => {
        console.log(err);
      });

    axiosInstance
      .post(`/viewPgmRequests/${id}`)
      .then((res) => {
        console.log(res);
      })
      .catch((err) => {
        console.log(err);
      });
  });

  const apprfn = () => {};
  return (
    <div>
      <div class="accordion-item">
        <h2 class="accordion-header">
          <button
            class="accordion-button"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#collapseTwo"
            aria-expanded="false"
            aria-controls="collapseTwo"
          >
            Programs to be Approved
          </button>
        </h2>
        <div
          id="collapseTwo"
          class="accordion-collapse collapse"
          data-bs-parent="#accordionExample"
        >
          <div class="accordion-body">
            <div class="container text-center">
              <div class="row">
                {/* trainerdata details mapped */}
                {pgmreq.length ? (
                  pgmreq.map((a) => {
                    return (
                      <div className="col">
                        <div class="card card-body">
                          <div className="main">
                            <div class="card" style={{ height: "170px" }}>
                              <div class="card-body">
                                <h5 class="card-title">{a.name}</h5>
                                <p class="card-text">Email : {a.email}</p>
                                <p class="card-text">Gender : {a.gender}</p>
                                <button
                                  onClick={() => {
                                    apprfn(a._id);
                                  }}
                                  class="btn btn-primary"
                                >
                                  Approve
                                </button>
                              </div>
                            </div>
                          </div>
                        </div>
                      </div>
                    );
                  })
                ) : (
                  <div class="card card-body">
                    <div className="main">
                      <div class="card" style={{ width: "18rem;" }}>
                        <div class="card-body">
                          <h5 class="card-title">No data</h5>
                        </div>
                      </div>
                    </div>
                  </div>
                )}
              </div>
            </div>
            {/* trainerdata details mapped */}
          </div>
        </div>
      </div>
      <div class="accordion-item">
        <h2 class="accordion-header">
          <button
            class="accordion-button"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#collapseTwo"
            aria-expanded="false"
            aria-controls="collapseTwo"
          >
            Approved Programs
          </button>
        </h2>
        <div
          id="collapseTwo"
          class="accordion-collapse collapse"
          data-bs-parent="#accordionExample"
        >
          <div class="accordion-body">
            <div class="container text-center">
              <div class="row">
                {/* trainerdata details mapped */}
                {approvedpg.length ? (
                  approvedpg.map((a) => {
                    return (
                      <div className="col">
                        <div class="card card-body">
                          <div className="main">
                            <div class="card" style={{ height: "170px" }}>
                              <div class="card-body">
                                <h5 class="card-title">{a.name}</h5>
                                <p class="card-text">Email : {a.email}</p>
                                <p class="card-text">Gender : {a.gender}</p>
                                <button
                                  onClick={() => {
                                    apprfn(a._id);
                                  }}
                                  class="btn btn-primary"
                                >
                                  Approve
                                </button>
                              </div>
                            </div>
                          </div>
                        </div>
                      </div>
                    );
                  })
                ) : (
                  <div class="card card-body">
                    <div className="main">
                      <div class="card" style={{ width: "18rem;" }}>
                        <div class="card-body">
                          <h5 class="card-title">No data</h5>
                        </div>
                      </div>
                    </div>
                  </div>
                )}
              </div>
            </div>
            {/* trainerdata details mapped */}
          </div>
        </div>
      </div>
    </div>
  );
}

export default ViewTrainerPrograms;
